description:
Instructions:
- If you want a single file, just use the links. This compilation is for collectors.
- Extract the x64 7z file to unpack the en-US x64 iso
- If you need a x32 version, you need to run the x32 en-US patch next
- Run the target exe file to apply a delta patch to the en-US version and
create a new iso for the target language. This will not delete the source iso.

